import React from 'react';
import './App.css';
import Header from './Header';
import Gallery from './Gallery';
import s from './App.module.css'
import Drag from './Drag'


function App() {
  return (
    <div className={s.app}>
      <Drag/>
        <Gallery/>
        <Header/>
    </div>
  );
}

export default App;
